  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Seney National
  Wildlife Refuge outlines Refuge accomplishments from February through April of 1942.
  The report begins by summarizing the weather conditions and wildfires during this
  period. Wildlife- including migratory birds, upland game birds, big game animals,
  furbearers, predators, rodents, and fish- is also covered. The Refuge development
  and maintenance section discusses physical developments and plantings. Resource
  management is outlined; topics include fur harvesting. The public relations section
  of the report describes Refuge visitors and violations.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
